import React from 'react'

const Todo = ({key, todo}) => {
  return (
    <div>
        <p>ID: {todo.id}</p>
        <p>title: {todo.title}</p>
        <p>Desc: {todo.desc}</p>
    </div>
  )
}

export default Todo
